// Signin.js
import React from "react";
import "./Signin.css";
import Navbar1 from "../Navbar";

function Signin() {
  return (
    <div className="signin-bg">
      <br />
      <Navbar1 />
      <div className="signin-box">
        <div className="circle-animation"></div>
        <div className="line"></div>
        <h1 className="form" style={{ color: "#75006f" }}>
          <span>Log</span>
          <span>&nbsp;in</span>
        </h1>
        <div className="signin-inputbox">
          <input className="signin-input" type="text" required="required" />
          <span>Username</span>
        </div>
        <div className="signin-inputbox">
          <input className="signin-input" type="password" required="required" />
          <span>Password</span>
        </div>
        <button className="signin-button">Log in</button>
        <br />
        <div style={{ color: "white", fontSize: "20px" }}>
          Forgot{" "}
          <a style={{ color: "#75006f", textDecoration: "none" }}>Password</a>?
        </div>
        <div style={{ color: "white", fontSize: "20px" }}>
          New to website{" "}
          <a style={{ color: "#75006f", textDecoration: "none" }}>Sign Up</a>{" "}
          Here
        </div>
      </div>
    </div>
  );
}

export default Signin;
